Mempengaruhi dan Mengawasi jalannya Penyelenggaraan Negara Agar senantiasa Berdasarkan Pada Ideologi Pancasila 1 Juni 1945 dan Undang - Undang Dasar Negara Republik Indonesia 1945, Serta Jalan TRISAKTI Sebagai Pedoman Startegi dan Tujuan KEbijakan Politik Partai Demi Terwujudnya Pemerintahan yang Kuat, Efektif, Bersih, dan Berwibawa;

